var mongoose = require('mongoose');
var Campground = require('./models/campground');
var comment = require('./models/comment');

var data = [{
        name: "Warm breeze",
        image: "https://farm5.data:image/jpeg;data:image/jpeg;base64,,:image/jpeg;base64,:image/jpeg;base64,:image/jpeg;base64,:image/jpeg;base64,:image/jpeg;base64,:image/jpeg;base64,.com/4016/4369518024_0f64300987.jpg",
        description: "1st one"
    },
    {
        name: "Cold breeze",
        image: "https://data:image/jpeg;base64,.staticflickr.com/4016/4369518024_0f64300987.jpg",
        description: "2nd one"
    },
    {
        name: "Autumn breeze",
        image: "https://data:image/jpeg;base64,.data:image/jpeg;base64,.com/4016/4369518024_0f64300987.jpg",
        description: "3rd one"
    }

];

function seedDb() {
    // Here remove all the campgrounds 
    Campground.remove({}, function(err) {
        if (err) {
            console.log(err);
        }
        console.log("removed all camgrounds");

        // Here add a few campgrounds
        data.forEach(function(seed) {
            Campground.create(seed, function(err, camp) {
                if (err) {
                    console.log(err);
                } else {
                    console.log("Created campground");
                    // Create a comment
                    comment.create({
                        text: "this is a beatuiful place",
                        author: "Aman"

                    }, function(err, data) {
                        if (err) {
                            console.log(err);
                        } else {
                            camp.comments.push(data);
                            camp.save();
                            console.log("comments added");
                        }
                    });

                }
            });
        });
    });
}

module.exports = seedDb;